import React, { Component } from 'react';
import NavBar from '../NavBar/NavBar';
import Image from './image1.jpeg';
import './HomePge.css';

class HomePage extends Component {

    render() { 
        return (
            <div className="HomePage1">
            <NavBar />
   <div classname="HomePage">

<div className="”gallery”">
  <figure className="”gallery__item gallery__item--1">
    <img src={Image} alt="Image 1" />
  </figure>
  <figure className="gallery__item gallery__item--2">
    <img src={Image} className="gallery__img" alt="Image 2" />
  </figure>
  <figure className="gallery__item gallery__item--3">
    < img src = {
      Image
    }
    className = "gallery__img"
    alt = "Image 3" / >
  </figure>
  <figure className="gallery__item gallery__item--4">
    <img src="img/image-4.jpg" className="gallery__img" alt="Image 4" />
  </figure>
  <figure className="gallery__item gallery__item--5">
    <img src="img/image-5.jpg" className="gallery__img" alt="Image 5" />
  </figure>
  <figure className="gallery__item gallery__item--6">
    <img src="img/image-6.jpg" className="gallery__img" alt="Image 6" />
  </figure>
</div>

</div>

            </div>

          );
    }
}

export default HomePage;
